description:
This beautiful house in Bridgeway Lakes area, has 4 BR/3 BA, plus huge office/game room and the hobby room. Back to the open space on a large lot. Steps to lake, parks, and scenic trails. Great neighborhood with the recreation center, library, boathouse on lake, and the shopping center. Excellent K-8 and high schools; Short commute to downtown Sacramento, UC Davis, CSUS, and UCD Medical Center; Easy access to all freeways. 

 Granite kitchen counter/island tops, ample cherry finish cabinets; And many other upgrades through the house;
 Large family room w/ fireplace; Formal dining room, living room, hobby room, and down stair guest room;
 Luxurious master suite with separate bath tub, shower, and lake view; 
 Central controlled, dual zoned AC/H for energy saving; 
 Large landscaped backyard with patio, storage shed, gazebo, vegetable garden, and the fruit trees;
Lease Details: Tenants are responsible for yard maintenance and all utilities including water and city services. NS/ND/NP please. Min. 1 year lease agreement required. Credit history and past rental references will be checked. Application processing fee is $30 per applicant.

Adorable 1bed/1bath in Midtown (Alkali Flat)!

Virtual Tour:

 Unit #4 is located on the 2nd floor and features hardwood floors throughout. Large living room and bedroom. A washer/dryer is available in the unit. 
Off street parking available. 

Awesome Location:
 Golden1 Center is 4 minute bike ride or 14 minute walk; 
 California State Capitol & Park is 6 minute bike ride or 12 minute walk; 
 Great restaurants, cafes, nightlife, shopping, theater complex (Crest, IMAX), gyms, public library, etc. within waking distance; 
 Easy access to public transportation (light rail, commuter trains, buses, etc.) ; 
All major freeways are also easily accessible; 
 Railyards Stadium (scheduled to be completed by the start of the 2022 Major League Soccer season) is 4 minute bike ride or 14 minute walk.
Lease Details: Terms:
 One year lease agreement minimum. 
 Rent: $1295 - Unfurnished;
 Security Deposit: $1295 - Unfurnished; 
 Furnished option available for additional monthly fee. Please inquire. 
 Tenant pay for Electricity and Gas (Landlord covers water, sewer and garbage)
 Good credit, income & previous rental history required.
 Renter's insurance is required (Approx. $13/month).
 Submit application through Zillow.

Everything you might need is there. 
1. Separate family and living rooms; 2. Master bedroom w. Walking closet; 3. Laundry unit is between bedrooms; 4. Small deck; 5. Good size one car garage; 6. Partially furnished ( negotiable); 7. Nice upgraded flooring; 8. Good location w. all type of shopping around; 9. Community pool; 10. Friendly neighborhood;
Lease Details: The house will be available July 1st. Owner pays trash, sewer, and HOA. If tenants pay all those bills the price would be reduced up to $1550

-Mid Century Modern design = popular style;
-Large full kitchen with gas stove, dishwasher, refrigerator
-Dining room area;
-Laminate wood floors, tile floors, and carpet in 2 bedrooms;
-Large bathroom;
-1st floor unit;
-Central Heat and Air;
-Tons of storage cabinets and closets;
-Laundry room;
-Locked front gate into property;
-Near Urban Roots Brewery & Smokehouse Restaurant
-Street parking with free residential parking permit;
Lease Details: Lease duration: 1 Year LEASE.
Application Fee = $50.00
Owner pays: water, sewer, trash services;
Tenant pays: SMUD electrical, PG&E gas, Comcast internet;
NO PETS;
